O Protocolo de Quioto é um tratado internacional ambiental de 1997 com compromissos mais rígidos para a redução da emissão dos gases que produzem o efeito estufa (causa do atual aquecimento global). O acordo é consequência de uma série de eventos iniciada com a Toronto Conference on the Changing Atmosphere, no Canadá (outubro de 1988), seguida pelo IPCC's First Assessment Report em Sundsvália, Suécia (agosto de 1990) e que culminou com a Convenção-Quadro das Nações Unidas sobre a Mudança Climática (CQNUMC, ou UNFCCC em inglês) na ECO-92 no Rio de Janeiro, Brasil (junho de 1992). Também reforça seções da CQNUMC. Discutido e negociado em Quioto no Japão em 1997, foi aberto para assinaturas em 11 de Dezembro de 1997 e ratificado em 15 de março de 1999. Sendo que para este entrar em vigor precisou que 55 países, que juntos, produzem 55% das emissões, o ratificassem, assim entrou em vigor em 16 de fevereiro de 2005, depois que a Rússia o ratificou em Novembro de 2004. Por ele se propõe um calendário pelo qual os países-membros (principalmente os desenvolvidos) têm a obrigação de reduzir a emissão de gases do efeito estufa em, pelo menos, 5,2% em relação aos níveis de 1990 no período entre 2008 e 2012, também chamado de primeiro período de compromisso (para muitos países, como os membros da UE, isso corresponde a 15% abaixo das emissões esperadas para 2008). As metas de redução não são homogêneas a todos os países, colocando níveis diferenciados para os 38 países que mais emitem gases. Países em franco desenvolvimento (como Brasil, México, Argentina e Índia) não receberam metas de redução, pelo menos momentaneamente. A redução dessas emissões deverá acontecer em várias atividades econômicas. O protocolo estimula os países signatários a cooperarem entre si, através de algumas ações básicas: 
* Reformar os setores de energia e transportes; 
* Promover o uso de fontes energéticas renováveis; 
* Eliminar mecanismos financeiros e de mercado inapropriados aos fins da Convenção; 
* Limitar as emissões de metano no gerenciamento de resíduos e dos sistemas energéticos; 
* Proteger florestas e outros sumidouros de carbono. Se o Protocolo de Quioto for implementado com sucesso, estima-se que a temperatura global reduza entre 1,4°C e 5,8 °C até 2100, entretanto, isto dependerá muito das negociações pós período 2008/2012, pois há comunidades científicas que afirmam categoricamente que a meta de redução de 5,2% em relação aos níveis de 1990 é insuficiente para a mitigação do aquecimento global.
